import { Chart, Tooltip, Axis, Line, Point } from 'viser-react';
import * as React from 'react';

const data = [
  { type: 'A', value: 3 },
  { type: 'A', value: 4 },

  { type: 'A', value: 13 },
];





const scale = [
            {
                dataKey: 'name',
                type: 'cat',
                values: ['Alexander', 'Marie', 'Maximilian', 'Sophia', 'Lukas', 'Maria', 'Leon', 'Anna', 'Tim', 'Laura']
            },
            {
                dataKey: 'day',
                type: 'cat',
                values: ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday']
            }
        ];


class Reactjs extends React.Component {
  render() {
    return (
      <Chart forceFit height={400} data={data} scale={scale}>
        <Tooltip />
        <Axis />
        <Line position="year*value" />
        <Point position="year*value" shape="circle"/>
      </Chart>
    );
  }
}
export default Reactjs
